import React, { useEffect } from "react";
import Proposition from "../../component/Proposition/Proposition";
import axios from "axios";
import "./Main.scss";

const Main: React.FC = () => {

  useEffect(() => {
  fetch("https://google-translate20.p.rapidapi.com/translate?text=One%20idea%20behind%20Java's%20automatic%20memory%20management%20model%20is%20that%20programmers%20should%20be%20spared%20the%20burden%20of%20having%20to%20perform%20manual%20memory%20management.%20In%20some%20languages%20the%20programmer%20allocates%20memory%20to%20create%20any%20object%20stored%20on%20the%20heap%20and%20is%20responsible%20for%20later%20manually%20deallocating%20that%20memory%20to%20delete%20any%20such%20objects.%20If%20a%20programmer%20forgets%20to%20deallocate%20memory%20or%20writes%20code%20that%20fails%20to%20do%20so%20in%20a%20timely%20fashion%2C%20a%20memory%20leak%20can%20occur%3A%20the%20program%20will%20consume%20a%20potentially%20arbitrarily%20large%20amount%20of%20memory.%20In%20addition%2C%20if%20a%20region%20of%20memory%20is%20deallocated%20twice%2C%20the%20program%20can%20become%20unstable%20and%20may%20crash.%20Finally%2C%20in%20non%20garbage%20collected%20environments%2C%20there%20is%20a%20certain%20degree%20of%20overhead%20and%20complexity%20of%20user-code%20to%20track%20and%20finalize%20allocations.&tl=hi&sl=en")
  .then(response => {
    response.json();
  })
  .then(res => console.log(res))
  .catch(err => {
    console.error(err);
  });
  }, []);

  return (
    <div className="page">
      <Proposition />

    </div>
  );
};

export default Main;
